if(window.RealValue){RealValue.add("timestamp",{get:function(){var b=$.trim(this.autoVal()),a=b.split("/"),c=new Date(+a[2],+a[1]-1,+a[0]);return isNaN(+c)?0:+c},set:function(b){if(!isNaN(b)){b=new Date(b)}var a=[b.getDate(),b.getMonth(),b.getFullYear()].join("/");this.autoVal(a)}});RealValue.add("checkbox",{get:function(){return this.prop("checked")},set:function(a){this.prop("checked",Boolean(a))}});RealValue.add("perc",{symbol:" %",get:function(){var a=RealValue.field(this);return +(this.autoVal().replace(",",".").replace(a.symbol,""))},set:function(b){var a=RealValue.field(this);b=+String(b).replace(",",".");this.autoVal(b.toFixed(2).replace(".",",")+a.symbol)},on:{change:function(c){var a=$(this);if(!$.trim(a.autoVal())){return}var b=a.rval();a.rval(b)}}});RealValue.add("number",{get:function(){var a=this.autoVal();if(isNaN(+a)){a=String(this.autoVal()).replace(",",".")}return +a},set:function(a){a=String(a).replace(",",".");var b=a.split(".");if(b[1]){a=(+a).toFixed(b[1].length)}this.autoVal(a.replace(".",","))},on:{change:function(c){var a=$(this);if(!$.trim(a.autoVal())){return}var b=a.autoVal().replace(",",".");if(isNaN(+b)){return a.autoVal("")}a.rval(b)}}});RealValue.add("icons",{get:function(){var a=this.find(".selected");return a.length?a.attr("icon-value"):""},set:function(a){this.find(".selected").removeClass("selected");this.find("[icon-value='"+a+"']").addClass("selected")},on:{click:function(c){var b=$(c.target).closest(".icon"),a=b.attr("icon-value");$(this).rval(a)}}})};